(5035, '2023-11-20 22:41:32', 'tts', '383358222972616705', '474935164451946506', '983315338886279229', 'Impara\nPenso al futuro ma vivo il presente\nNon ha senso fare progetti se non sai fare niente\nFino a ieri annegavo tra i dubbi, le mie insicurezze\nMi hanno imparato a trasformare i sogni in certezze\nHo scoperto il rap da poco\nOra lo scrivo come se fosse un gioco\nSfodero un sorriso davanti all\'obiettivo, scelgo una posa e metto a fuoco\nE\' bello pensare a quanto  facile sfondare\nNel mondo della musica non ricevi senza dare\nAccendi la radio senti una canzone\nHai l\'impressione che anche per te ci sia un\'occasione\nMa non serve a nulla il talento se c\' corruzione\nLa Mafia  un vulcano in continua eruzione\nEhy...\nEhy...\nVedi cio che vuoi ma la realt  diversa\nSe pensi che si avr giustizia  una scommessa persa\nNon c\' bisogno che mi ringrazi, per me  un passatempo\nIn futuro sar un lavoro, perch continuo a crederci e non penso al tempo\nOra, se vuoi essere onesto dammi ci che mi spetta\nPerch prima degli altri ho raggiunto la vetta'),
